// File: src/pages/CreateShape.js
import React, { useState } from 'react';
import { createShape } from '../services/api';

const CreateShape = () => {
  const [shape, setShape] = useState({ shapeId: '' });
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setShape((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createShape(shape);
      setMessage('Shape created successfully!');
      setShape({ shapeId: '' });
    } catch (err) {
      setMessage('Failed to create shape.');
    }
  };

  return (
    <div>
      <h1>Create Shape</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="shapeId"
          placeholder="Shape ID"
          value={shape.shapeId}
          onChange={handleChange}
          required
        />
        <button type="submit">Create Shape</button>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
};

export default CreateShape;
